// @description  try to take over the world!
// @author       ionvop
// @match        https://www.facebook.com/*
// @match        https://www.messenger.com/*
// @icon         data:image/jpeg;base64,
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    let jcId = "432995788";
    let inaId = "433116683";
    let jcImg = "data:image/png;base64,";
    let inaImg = "data:image/png;base64,";

    function identifySensei() {
        findElementsContaining(jcId).forEach(element => {
            for (let attr of element.attributes) {
                if (attr.value.includes(jcId)) {
                    attr.value = jcImg;
                    break;
                }
            }
        })

        findElementsContaining(inaId).forEach(element => {
            for (let attr of element.attributes) {
                if (attr.value.includes(inaId)) {
                    attr.value = inaImg;
                    break;
                }
            }
        })
    }

    document.addEventListener("click", function(event) {
        identifySensei();
    });

    /**
     * Finds all elements in the document that have an attribute containing the specified substring. This docstring exists cus JavaScript doesn't have type hinting. And no, I won't use TypeScript
     *
     * @param {string} substring - The substring to search for within the attributes' values.
     * @returns {Element[]} An array of elements that have at least one attribute containing the substring.
     */
    function findElementsContaining(substring) {
        let result = [];

        document.querySelectorAll("*").forEach(element => {
            for (let attr of element.attributes) {
                if (attr.value.includes(substring)) {
                    result.push(element);
                    break;
                }
            }
        });

        return result;
    }
})();